css:
.highlight.uncovered .region {
  background-color: #ff5757;
  opacity: 0.2;
}
.highlight.covered .region {
  background-color: #ff7ac6;
  opacity: 0.2;
}
.line-number.uncovered {
  color: #f8f8f2 !important;
  background-color: #ff5757;
}
.line-number.covered {
  color: #f8f8f2 !important;
  background-color: #ff7ac6;
}
